import classes from "./Skills.module.css";
import Container from "react-bootstrap/esm/Container";

const Skills = () => {
    return ( 

        <section className={classes.skills}>
            <Container>
                <h3 className={classes.skills__header}>Skills</h3>
            </Container> 
        </section>
     );
}

export default Skills;
